INSERT INTO blog VALUES
    (NULL,'19.2.0','https://www.realta.co.id/hr/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'REALTA','admin','realta@realta.co.id','$2y$10$JlCoprDK6vy60FcdTaIfOekLt4qoCUoFF.Mq18EYK4063FlfsE2CS',0,1,'2018-09-06 14:51:06','2021-05-11 11:12:47',0,'{"admin_style":"","admin_language":"","language":"","editor":"","helpsite":"","timezone":""}','0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,104,'Proses HR yang dapat di akses dari rumah','sistem-hr-akses-dari-rumah','<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="color: #000000; font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;">Pandemi COVID-19 merupakan pandemi yang mempengaruhi seluruh dunia. Dikarenakan tingkat penyebarannya yang cepat, maka untuk menekan jumlah kasus baru, protokol kesehatan...</span></p>','<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><img src="images/custom__1.png" alt="Proses HR yang dapat di akses dari rumah | hr cloud" /></span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Pandemi COVID-19 merupakan pandemi yang mempengaruhi seluruh dunia. Dikarenakan tingkat penyebarannya yang cepat, maka untuk menekan jumlah kasus baru, protokol kesehatan menganjurkan semua orang untuk mengurangi kontak dan tatap muka, menggunakan masker, dan sebisa mungkin untuk tetap di rumah saja. Dampak dari protokol kesehatan yang diberlakukan oleh pemerintah tersebut mengakibatkan beberapa perusahaan mulai memberlakukan Work From Home atau kerja dari rumah.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> </span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Untuk perusahaan yang menganjurkan karyawannya bekerja di rumah, proses yang tadinya dikerjakan di kantor menjadi dilakukan di rumah dengan berbagai macam keterbatasan. Dalam situasi WFH ini, semua pekerjaan harus dikerjakan dengan efektifitas sama seperti bekerja di kantor. Akan tetapi, bagaimana dengan HRD yang harus menangani proses-proses HR seperti proses gaji, absensi,  dan lain sebagainya yang biasanya dilakukan di kantor? Biasanya,  HRD melakukan proses perhitungan gaji dan absensi adalah dengan sistem yang sudah dipakai di kantor. Untuk melakukan tugas HRD selagi WFH tentu akan tidak efektif bila demikian.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt; text-align: center;"><a style="font-size: 12.16px; text-align: center;" title="5 Cara Kerja HRD" href="index.php/blog/article-news/102-tetap-mengabsen-meskipun-wfh">Baca juga : Tetap Mengabsen Meskipun WFH</a></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Data yang hanya bisa diakses di kantor tentu akan menyebabkan keterbatasan. Apabila dihadapkan pada skenario kantor dipaksa tutup oleh pemerintah karena ada karyawan yang terkena COVID-19, HRD harus tetap melaksanakan tugas operasional mereka, seperti memproses perhitungan gaji dan absensi. Apabila HRD bergantung pada data yang ada di kantor untuk memproses hal-hal yang disebutkan di atas, apakah HRD masih bisa melakukan tugasnya saat kantor tutup tanpa mempengaruhi kinerja HRD?    </span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> </span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">PT Realta Chakradarma memiliki solusi untuk masalah yang disebutkan di atas. Sekarang dengan SIAP</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 0.6em; vertical-align: super;">+P</span></span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">, proses-proses HR dapat diakses dari rumah. SIAP</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 0.6em; vertical-align: super;">+P</span></span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> memampukan setiap proses-proses HR untuk dilakukan di </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">cloud</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">. Jadi selama ada jaringan internet dari rumah, HRD dapat mengerjakan setiap transaksi-transaksi HR di rumah. Tidak perlu untuk bergantung pada data yang disimpan dan hanya dapat diakses di kantor lagi</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Untuk informasi lebih lanjut, hubungi kami di nomor telepon +6221 386 1772,  di</span><a style="text-decoration: none;" href="https://api.whatsapp.com/send?phone=628111221789&amp;text=Hallo%20PT%20Realta..."> </a><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><a style="text-decoration: none;" href="https://api.whatsapp.com/send?phone=628111221789&amp;text=Hallo%20PT%20Realta..."><span style="font-size: 11pt; font-family: Arial; color: #ec008b; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Official Whatsapp</span></a> +62 811 1221 789 (chat only), kirim email ke info@realta.co.id, atau kunjungi website</span> <span style="font-size: 11pt; font-family: Arial; color: #ec008b; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: underline; -webkit-text-decoration-skip: none; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;"><a href="http://www.realta.co.id">www.realta.co.id</a></span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #ec008b; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: underline; -webkit-text-decoration-skip: none; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;"><a style="color: #0000cc; font-family: Tahoma, Helvetica, Arial, sans-serif; font-size: 12.16px; white-space: normal;" title="Realta HR System Pricing" href="pricing"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/blog/blog_promo_siap_1.jpg" alt="" /></a></span></p>',1,'2020-09-30 05:26:36',NULL,'2021-02-25 05:04:58','2020-10-07 09:13:23','0000-00-00 00:00:00','{"image_intro":"images\\/custom__1.png","float_intro":"","image_intro_alt":"Proses HR yang dapat di akses dari rumah | hr cloud","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"article_layout":"","show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","info_block_show_title":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_associations":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_page_title":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":"","spfeatured_image":"","spfeatured_image_alt":"","post_format":"standard","gallery":"","audio":"","video":"","link_title":"","link_url":"","quote_text":"","quote_author":"","post_status":""}',18,'hr cloud, HR sistem terbaik, software hrd','Melakukan proses-proses HR dari rumah dengan menggunkan cloud. HRD dapat mengerjakan setiap transaksi-transaksi HR di rumah',783,'{"robots":"","author":"","rights":"","xreference":""}','*',NULL,NULL,'admin','louis','blog',1,0,15,5,'/hr/blog/article-news/104-sistem-hr-akses-dari-rumah',NULL,NULL),
